import "../App.css";

function Tentang() {
  return (
    <div className="grid grid-cols-1 gap-4 lg:grid-cols-3 lg:gap-8 bg-gray-200">
      <div className="h-screen rounded-lg m-3">
        <h1 className="text-2xl font-bold items-center m-20">
          <span className="flex items-center">
            <span className="pr-6 text-sm">Kominfo Lhokseumawe</span>
            <span className="h-px flex-1 bg-black"></span>
          </span>
          <h1 className="text-2xl my-10">Tentang kami</h1>
        </h1>
      </div>
      <div className="h-screen rounded-lg m-3">ini satu lagi</div>
    </div>
  );
}

export default Tentang;
